import React from 'react';
import './cart-icon.styles.scss';
import {ReactComponent as ShoppingIcon} from '../../assets/shopping-bag';

const CartIcon = () => (
    <div className='cart-icon'>
        <ShoppingIcon />
        <span className='item-count'>0</span>
    </div>
);

export default CartIcon;
